  \"2016-01-09T11:51:28.844424\",\n\t\"name\": \"distribution-of-georgia-oyster-reefs\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The feature class in this ESRI Geodatabase
  contains polygons representing oyster reefs along the Georgia coastal waterways
  from Chatham County south to Glynn County. A pilot project was completed for certain
  coastal regions in 2013, and the remaining regions in the project area were completed
  in 2015. Oyster polygons were collected by heads-up digitization using 4-band, 6\"
  resolution DMC digital aerial imagery as the source imagery. The source imagery
  was collected during the period from November 2012 to February 2013. This mapping
  effort was performed by Quantum Spatial under contract to the Georgia Department
  of Natural Resources. The minimum mapping unit is 5 square meters, though collecting
  features under that was at the discretion of the contractor.\",\n\t\"license_title\":
